import React from 'react';
import Navbar from '../components/common/Navbar';
import Dashboard from '../components/Dashboard/Dashboard';

const DashboardPage = () => {
  return (
    <div>
      <Navbar />
      <Dashboard />
    </div>
  );
};

export default DashboardPage;
